import logo from './logo.svg';
import './App.scss';
import { Route } from 'react-router-dom';
import Layout from './components/Layout';
function App() {
  return (
    <Route>
      <Route path='/' element={<Layout/>}></Route>
    </Route>
    );
}

export default App;
